WebAssembly.instantiate(getBinaryCodeSTunedBar3(), faust.importObject)
            .then(dsp_module => {
                  faust.STunedBar3_instance = dsp_module.instance;
                  registerProcessor('STunedBar3', STunedBar3Processor);
            })
            .catch(function() { console.log("Faust STunedBar3 cannot be loaded or compiled"); });


